import React from 'react'

const web_cam = () => {
  // Start the webcam
function start(){
fetch('http://127.0.0.1:3001/webcam?action=start')
.then(response => {
    if (response.ok) {
        console.log('Webcam detection started.');
    } else {
        console.error('Failed to start webcam detection.');
    }
})
.catch(error => console.error('Error:', error));
}

function end(){
// Stop the webcam
fetch('http://127.0.0.1:3001/webcam?action=stop')
.then(response => {
    if (response.ok) {
        console.log('Webcam detection stopped.');
    } else {
        console.error('Failed to stop webcam detection.');
    }
})
.catch(error => console.error('Error:', error));
}
  return (
    <div>
                  <button
                className="text bg-indigo-600 text-white border border-gray-300 rounded font-semibold cursor-pointer p-2 px-5 hover:bg-indigo-500 m-auto"
                onClick={start}
            >
                Start
            </button>
            <button
                className="text bg-indigo-600 text-white border border-gray-300 rounded font-semibold cursor-pointer p-2 px-5 hover:bg-indigo-500 m-auto"
                type="submit"
                onClick={end}
            >
                End
            </button>


    </div>
  )
}

export default web_cam
